import Image from 'react-bootstrap/Image';
import image from './banner.png';
import Button from "react-bootstrap/Button";
import './bannerStyle.css'
import { Col, Container, Row } from 'react-bootstrap';
function HomeBanner() {

    return (
        <Container>
            <Row>
                <Col lg className='justify-content-md-center'>
                    <div style={{ 'padding-top': '20%' }}>
                        <p style={{ 'color': 'white', 'float': 'left', 'width': '500px' }}>
                            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer elementum diam lacus, magnis.
                            Diam tempus lorem laoreet mattis orci sagittis velit. Amet scelerisque diam non quis amet adipiscing.
                        </p>
                    </div>
                    <div style={{ 'padding-top': '15%'} }>
                        <Button variant="primary">
                            {'Order Now'}
                        </Button>
                    </div>
                </Col>
                <Col>
                    <div style={{ 'float': 'right' }}>
                        <Image src={image} rounded alt="banner" height={400} width={500}>
                        </Image>
                    </div>
                </Col>
            </Row>
        </Container>
    );

}

export default HomeBanner;
